import React, { useState, useEffect, useContext } from "react";
import { Context as DataContext } from "../context/DataContext";

const Landing = () => {
  const { state, getData } = useContext(DataContext);
  const { data } = state;

  useEffect(() => {
    getData();
  }, []);

  return (
    <div className="">
      <div className="p-10 h-24 w-screen shadow-lg items-center">
          <div className="w-auto h-16 bg-center bg-no-repeat bg-cover" style={{ backgroundImage: `URL(https://s3.amazonaws.com/media.widencdn.net/logos/claytonhomes/2daceb96-4bcb-4652-9e6c-7d527566cfa2/client-logo/Clayton_Corporate_Logo%401x.png)` }}></div>
      </div>
      <div className="p-10 grid grid-cols-1 md:grid-cols-3 gap-5">
        {data.map((item) => (
          <div key={item.homeName} className="shadow-md w-full flex flex-col">
            <img src={item.imageURL} className="" />
            <div className="flex flex-col p-5">
              <h1 className="text-3xl">{item.homeName}</h1>
              <subtitle className="text-gray-400">
                Starting in the ${item.startingPrice}s
              </subtitle>
              <div>
                {item.sqft} sq. ft {item.beds} beds {item.baths} baths{" "}
                {item.isMultiSection ? "Multi Section" : null}
              </div>
            </div>
          </div>
        ))}
      </div>
      <div>
        <p>Copyright 2020 Clayton Homes.</p>
        <p>All Rights Reserved.</p>
      </div>
    </div>
  );
};

export default Landing;
